package oops.com;
//Object and Class Example: main outside the class
class test1{
	
	int id;
	String name;
}
public class object_oops  {
	public static void main(String[] args) {
		// TODO Auto-generated method stub

		test1 s1=new test1();
		s1.id=123;
		s1.name="QWERTY";
		//s1.equals(s1);
	System.out.println(s1.id+" "+s1.name);	
	}

}
